INSERT INTO `explain_question_n_e_os` VALUES (4,'Tận tâm','Trung bình','2018-11-02 06:41:32','2018-11-02 06:43:28','<p>Người c&oacute; điểm số trung b&igrave;nh ở mặt C (Tận t&acirc;m) c&oacute; thể chuyển c&ocirc;ng việc sang một b&ecirc;n để theo đuổi việc giải tr&iacute; vui chơi. Họ tổ chức kh&aacute; tốt v&agrave; kh&aacute; đ&aacute;ng tin cậy, c&oacute; mức độ tự gi&aacute;c kỷ luật ở mức trung b&igrave;nh.</p>'),(5,'Tận tâm','Cao','2018-11-02 06:43:15','2018-11-02 06:43:15','<p>Người c&oacute; điểm số cao C (Tận t&acirc;m) l&agrave; những người tỉ mỉ, đ&uacute;ng giờ, v&agrave; đ&aacute;ng tin cậy. Họ c&oacute; một nhu cầu tương đối cao đối với việc đạt th&agrave;nh t&iacute;ch. Họ tổ chức tốt v&agrave; đ&aacute;ng tin cậy v&agrave; thực hiện c&aacute;c cam kết họ đ&atilde; l&agrave;m. Họ c&oacute; &yacute; thức tự gi&aacute;c, c&oacute; tr&aacute;ch nhiệm một c&aacute;ch nghi&ecirc;m t&uacute;c. Họ l&agrave; người cẩn thận, đ&aacute;ng tin cậy, chăm chỉ, v&agrave; ki&ecirc;n tr&igrave;. Về mặt t&iacute;ch cực, điểm mặt C cao c&oacute; li&ecirc;n quan đến th&agrave;nh t&iacute;ch học tập v&agrave; nghề nghiệp, về mặt ti&ecirc;u cực, n&oacute; c&oacute; thể dẫn đến sự kén chọn, kỹ t&iacute;nh, sự ra tay &eacute;p buộc, hoặc h&agrave;nh vi tham c&ocirc;ng tiếc việc</p>'),(6,'Dễ chấp nhận','Thấp','2018-11-02 06:44:10','2018-11-02 06:44:10','<p>Những người c&oacute; điểm thấp ở mặt n&agrave;y tương đối &iacute;t quan t&acirc;m đến người kh&aacute;c. Họ thường c&oacute; thể v&ocirc; t&acirc;m hoặc kh&ocirc;ng suy nghĩ trong tương t&aacute;c của họ. Họ c&oacute; xu hướng xem những người kh&aacute;c v&agrave; &yacute; tưởng từ quan điểm ph&ecirc; b&igrave;nh. Th&aacute;i độ của họ thường c&oacute; khuynh hướng cứng rắn trong hầu hết c&aacute;c t&igrave;nh huống. Họ c&oacute; khả năng cạnh tranh v&agrave; c&oacute; thể kh&aacute; thể hiện cảm x&uacute;c th&ugrave; địch một c&aacute;ch trực tiếp. Mọi người c&oacute; thể m&ocirc; tả họ như l&agrave; một người cứng đầu hoặc &iacute;ch kỷ. Mặc d&ugrave; những người n&agrave;y thường kh&ocirc;ng được y&ecirc;u th&iacute;ch bởi những người kh&aacute;c, họ thường được t&ocirc;n trọng v&igrave; sự độc lập của họ. Sự dẻo dai về mặt cảm x&uacute;c v&agrave; khả năng cạnh tranh của họ c&oacute; thể l&agrave; cơ sở trong nhiều vai tr&ograve; x&atilde; hội v&agrave; kinh doanh.</p>'),(7,'Dễ chấp nhận','Trung bình','2018-11-02 06:44:32','2018-11-02 06:44:32','<p>Người c&oacute; điểm trung b&igrave;nh c&oacute; thể th&ocirc;ng cảm nhưng cũng c&oacute; thể hợp t&aacute;c. Họ tin tưởng nhưng kh&ocirc;ng cả tin, v&agrave; đ&atilde; sẵn s&agrave;ng cạnh tranh cũng như hợp t&aacute;c với những người kh&aacute;c</p>'),(8,'Dễ chấp nhận','Cao','2018-11-02 06:44:51','2018-11-02 06:44:51','<p>Người dễ đồng &yacute; về cơ bản l&agrave; vị tha. Đ&oacute; l&agrave; th&ocirc;ng cảm cho những người khác và sẵn sàng &nbsp;gi&uacute;p đỡ họ, v&agrave; tin rằng những người kh&aacute;c sẽ được những người kh&aacute;c đối xử c&ocirc;ng bằng lại với m&igrave;nh khi cần thiết</p>'),(9,'Dễ chấp nhận','Cao','2018-11-02 06:45:18','2018-11-02 06:45:18','<p>Người dễ đồng &yacute; về cơ bản l&agrave; vị tha. Đ&oacute; l&agrave; th&ocirc;ng cảm cho những người khác và sẵn sàng &nbsp;gi&uacute;p đỡ họ, v&agrave; tin rằng những người kh&aacute;c sẽ được những người kh&aacute;c đối xử c&ocirc;ng bằng lại với m&igrave;nh khi cần thiết</p>'),(10,'Nhiễu tâm','Thấp','2018-11-02 06:45:36','2018-11-02 06:45:36','<p>Người c&oacute; điểm của mặt Nhiễu t&acirc;m thấp th&igrave; cảm x&uacute;c của họ tương đối ổn định. Họ thường b&igrave;nh tĩnh, điềm đạm, v&agrave; thoải m&aacute;i, v&agrave; họ c&oacute; thể phải đối mặt với t&igrave;nh huống căng thẳng m&agrave; kh&ocirc;ng trở l&ecirc;n kh&oacute; chịu hoặc lo lắng.</p>'),(11,'Nhiễu tâm','Trung bình','2018-11-02 06:45:52','2018-11-02 06:45:52','<p>Người c&oacute; điểm mặt nhiễu t&acirc;m ở mức trung b&igrave;nh cho thấy sự ổn định cảm x&uacute;c của họ. Họ trải qua một số lượng b&igrave;nh thường của cảm x&uacute;c đau khổ v&agrave; c&oacute; một sự c&acirc;n bằng giữa sự h&agrave;i l&ograve;ng v&agrave; sự kh&ocirc;ng h&agrave;i l&ograve;ng với cuộc sống. Họ kh&ocirc;ng cao hoặc thấp trong sự tự đ&aacute;nh gi&aacute; về bản th&acirc;n. Khả năng đối ph&oacute; với stress của họ tốt như người b&igrave;nh thường.</p>'),(12,'Nhiễu tâm','Cao','2018-11-02 06:46:09','2018-11-02 06:46:09','<p>C&oacute; thể do nhiều những cảm x&uacute;c ti&ecirc;u cực, người c&oacute; điểm N cao cũng dễ c&oacute; những mẫu nhận thức khộng ph&ugrave; hợp, &iacute;t c&oacute; khả năng để kiểm so&aacute;t sự xung động của họ, v&agrave; ứng ph&oacute; với stress k&eacute;m hơn những người kh&aacute;c. Người c&oacute; điểm cao ở mặt C ủ rũ, qu&aacute; nhạy cảm, v&agrave; kh&ocirc;ng h&agrave;i l&ograve;ng với kh&iacute;a cạnh cuộc sống của họ. N&oacute;i chung họ c&oacute; l&ograve;ng tự tin thấp, v&agrave; c&oacute; thể c&oacute; những &yacute; tưởng v&agrave; kỳ vọng kh&ocirc;ng thực tế. Họ được lo lắng, thường l&agrave; người cảm thấy kh&ocirc;ng an to&agrave;n về bản th&acirc;n v&agrave; kế hoạch của họ. Bạn b&egrave; v&agrave; người quen của họ c&oacute; thể m&ocirc; tả đặc điểm ch&uacute;ng như thần kinh, tự &yacute; thức, căng thẳng v&agrave; dễ bị tổn thương so với người b&igrave;nh thường. (Điều quan trọng l&agrave; Nhiễu t&acirc;m l&agrave; một chiều k&iacute;ch của t&iacute;nh c&aacute;ch th&ocirc;ng thường, v&agrave; c&aacute;c điểm nhạy cảm thần kinh cao kh&ocirc;ng bao h&agrave;m việc người đ&oacute; bị bất kỳ rối loạn t&acirc;m l&yacute; n&agrave;o)</p>'),(13,'Cởi mở, ham học hỏi','Thấp','2018-11-02 06:47:20','2018-11-02 06:47:20','<p>Người c&oacute; điểm thấp ở mặt O (Cởi mở, ham học hỏi) c&oacute; xu hướng giữ nguy&ecirc;n h&agrave;nh vi ứng xử v&agrave; bảo thủ trong quan điểm. Họ th&iacute;ch những g&igrave; quen thuộc hơn l&agrave; những thứ mới mẻ, v&agrave; kh&ocirc;ng th&iacute;ch những trải nghiệm về mặt cảm x&uacute;c.&nbsp;</p>'),(14,'Cởi mở, ham học hỏi','Trung bình','2018-11-02 06:47:36','2018-11-02 06:48:14','<p>Những người c&oacute; điểm số mặt O (Cởi mở, ham học hỏi)&nbsp;ở mức trung b&igrave;nh thường kh&aacute; t&ograve; m&ograve; về cả những điều b&ecirc;n trong họ v&agrave; những g&igrave; b&ecirc;n ngo&agrave;i thế giới, v&agrave; họ c&oacute; kh&aacute; nhiều trải nghiệm phong ph&uacute;. Họ tương đối sẵn sang đ&oacute;n nhận những &yacute; tưởng mới v&agrave; gi&aacute; trị độc đ&aacute;o. Họ tương đối nhạy cảm với cảm x&uacute;c của bản th&acirc;n v&agrave; của người kh&aacute;c.&nbsp;</p>'),(15,'Cởi mở, ham học hỏi','Cao','2018-11-02 06:47:54','2018-11-02 06:47:54','<p>Những người cởi mở ham học hỏi mạnh mẽ (c&oacute; điểm số mặt O cao) thường t&ograve; m&ograve; về cả những điều b&ecirc;n trong họ v&agrave; những g&igrave; b&ecirc;n ngo&agrave;i thế giới, v&agrave; họ c&oacute; nhiều trải nghiệm phong ph&uacute; hơn những người kh&aacute;c. Họ sẵn sang đ&oacute;n nhận những &yacute; tưởng mới v&agrave; gi&aacute; trị độc đ&aacute;o, v&agrave; họ trải nghiệm cả những cảm x&uacute;c t&iacute;ch cực v&agrave; ti&ecirc;u cực nhiều hơn những người &iacute;t cởi mở hơn. Họ rất nhạy cảm với cảm x&uacute;c của ri&ecirc;ng m&igrave;nh v&agrave; c&oacute; một khả năng lớn hơn mức trung b&igrave;nh để nhận ra những cảm x&uacute;c của người kh&aacute;c. Họ đ&aacute;nh gi&aacute; cao về c&aacute;i đẹp trong nghệ thuật v&agrave; tự nhi&ecirc;n. Họ sẵn s&agrave;ng xem x&eacute;t những &yacute; tưởng mới v&agrave; c&aacute;c gi&aacute; trị v&agrave; c&oacute; thể hơi độc đ&aacute;o theo quan điểm của họ. Những người như vậy l&agrave; người tưởng tượng, t&aacute;o bạo, độc lập v&agrave; s&aacute;ng tạo</p>'),(16,'Hướng ngoại','Thấp','2018-11-02 06:48:57','2018-11-02 06:48:57','<p>Người c&oacute; điểm hướng ngoại thấp c&oacute; xu hướng hướng nội, hướng nội kh&ocirc;ng phải kh&ocirc;ng th&acirc;n thiện, họ độc lập chứ kh&ocirc;ng phải l&agrave; chậm chạp. Người hướng nội tr&ocirc;ng c&oacute; thể nh&uacute;t nh&aacute;t nhưng kh&ocirc;ng c&oacute; nghĩa l&agrave; họ th&iacute;ch ở một m&igrave;nh: họ kh&ocirc;ng nhất thiết bị &aacute;m sợ x&atilde; hội. Mặc d&ugrave; họ kh&ocirc;ng c&oacute; t&iacute;nh cởi mở của sự hướng ngoại, nhưng hướng nội kh&ocirc;ng c&oacute; nghĩa l&agrave; kh&ocirc;ng h&agrave;i lòng hoặc bi quan. T&ograve; m&ograve; l&agrave; một trong những đặc điểm của người hướng nội, họ thường th&iacute;ch t&igrave;m t&ograve;i nghi&ecirc;n cứu. Họ th&iacute;ch l&agrave;m hầu hết mọi thứ một m&igrave;nh hoặc với nh&oacute;m nhỏ. Họ tr&aacute;nh c&aacute;c b&ecirc;n lớn v&agrave; lớn, v&agrave; kh&ocirc;ng th&iacute;ch gặp gỡ những người mới. Họ thường y&ecirc;n lặng v&agrave; kh&ocirc;ng tự tin trong tương t&aacute;c nh&oacute;m. Họ hiếm khi trải nghiệm cảm x&uacute;c t&iacute;ch cực mạnh mẽ như niềm vui hay sự phấn kh&iacute;ch. Thực tế thấy rằng những người sống nội t&acirc;m kh&ocirc;ng nhất thiết c&oacute; nghĩa l&agrave; họ thiếu kỹ năng x&atilde; hội-hướng nội nhiều chức năng rất tốt trong c&aacute;c t&igrave;nh huống x&atilde; hội, mặc d&ugrave; họ c&oacute; thể th&iacute;ch để tr&aacute;nh ch&uacute;ng.&nbsp;</p>'),(17,'Hướng ngoại','Trung bình','2018-11-02 06:49:13','2018-11-02 06:49:13','<p>Những người c&oacute; t&iacute;nh hướng ngoại ở mức trung b&igrave;nh thường tương đối th&iacute;ch sự phấn kh&iacute;ch v&agrave; những k&iacute;ch th&iacute;ch, v&agrave; c&oacute; xu hướng kh&aacute; hướng đến sự vui vẻ trong những ho&agrave;n cảnh kh&aacute;c nhau. Họ tương đối lạc quan v&agrave; c&oacute; kh&aacute; nhiều năng lượng.</p>'),(18,'Hướng ngoại','Cao','2018-11-02 06:49:30','2018-11-02 06:49:30','<p>Sự hướng ngoại là h&ograve;a đồng, nhưng hướng ngoại chỉ l&agrave; một trong những đặc điểm của đời sống x&atilde; hội, ngo&agrave;i ra c&ograve;n c&oacute; những mối quan hệ v&agrave; c&aacute;c nh&oacute;m x&atilde; hội kh&aacute;c. Sự hướng ngoại thể hiện ở t&iacute;nh quyết đo&aacute;n, năng động, v&agrave; hoạt ng&ocirc;n. Những người c&oacute; t&iacute;nh hướng ngoại cao thường th&iacute;ch sự phấn kh&iacute;ch v&agrave; những k&iacute;ch th&iacute;ch, v&agrave; c&oacute; xu hướng hướng đến sự vui vẻ trong những ho&agrave;n cảnh kh&aacute;c nhau. Họ lạc quan, tr&agrave;n đầy năng lượng. Nh&acirc;n vi&ecirc;n b&aacute;n h&agrave;ng thường l&agrave; những người c&oacute; t&iacute;nh hướng ngoại rất cao, điểm cao ở mặt E v&agrave; c&aacute;c thang đo trong mặt E li&ecirc;n quan chặt chẽ với tới nghề l&agrave;m kinh doanh, doanh nghiệp.</p>'),(19,'Dễ chấp nhận','Cao','2019-04-16 17:02:56','2019-04-16 17:02:56','<table>\r\n	<tbody>\r\n		<tr>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n			<td>\r\n			<p>Người c&oacute; điểm mặt C (Tận t&acirc;m)&nbsp;thấp kh&ocirc;ng nhất thiết l&agrave; người thiếu nguy&ecirc;n tắc đạo đức, nhưng họ kh&ocirc;ng c&oacute; nhiều đ&ograve;i hỏi trong việc &aacute;p dụng ch&uacute;ng, cũng như họ kh&ocirc;ng c&oacute; nhiều động lực trong việc hướng tới mục ti&ecirc;u của m&igrave;nh. C&oacute; một số bằng chứng cho thấy họ th&iacute;ch hưởng thụ v&agrave; quan t&acirc;m đến t&igrave;nh dục.</p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>'),(20,'Tận tâm','Thấp','2019-04-28 13:11:51','2019-05-09 08:38:26','<p>Người c&oacute; điểm mặt C (Tận T&acirc;m) thấp kh&ocirc;ng nhất thiết l&agrave; người thiếu nguy&ecirc;n tắc đạo đức, nhưng họ kh&ocirc;ng c&oacute; nhiều đ&ograve;i hỏi trong việc &aacute;p dụng ch&uacute;ng, cũng như họ kh&ocirc;ng c&oacute; nhiều động lực trong việc hướng tới mục ti&ecirc;u của m&igrave;nh. C&oacute; một số bằng chứng cho thấy họ th&iacute;ch hưởng thụ v&agrave; quan t&acirc;m đến t&igrave;nh dục</p>');
