INSERT INTO `explain_question_r_i_a_s_e_cs` VALUES (12,'1','<p>Những người c&oacute; chỉ số cao ở lĩnh vực n&agrave;y l&agrave; những người ph&ugrave; hợp với những c&ocirc;ng việc li&ecirc;n quan đến kỹ thuật, c&ocirc;ng nghệ, hệ thống; ưa th&iacute;ch l&agrave;m việc với đồ vật, m&aacute;y m&oacute;c, mang t&iacute;nh thao t&aacute;c. C&aacute;c chuy&ecirc;n ng&agrave;nh c&oacute; thể ph&ugrave; hợp với em như: N&ocirc;ng nghiệp / L&acirc;m nghiệp; Quản trị/sửa chữa m&aacute;y m&oacute;c; Cơ kh&iacute; (chế tạo m&aacute;y, bảo tr&igrave; v&agrave; sữa chữa thiết bị, luyện kim, cơ kh&iacute; ứng dụng, tự động...), Điện - điện tử, địa l&yacute; - địa chất (đo đạc, vẽ bản đồ địa ch&iacute;nh), dầu kh&iacute;, hải dương học, M&aacute;y t&iacute;nh; X&acirc;y dựng; Thợ m&aacute;y / C&ocirc;ng nh&acirc;n cơ kh&iacute;; Kỹ sư kỹ thuật; Ng&agrave;nh Dịch vụ; Nấu ăn</p>','2019-05-12 16:55:04','2019-05-12 16:55:04'),(13,'2','<p>Những người c&oacute; chỉ số cao ở lĩnh vực n&agrave;y l&agrave; những người c&oacute; sở th&iacute;ch xem x&eacute;t, học tập, nghi&ecirc;n cứu, ph&acirc;n t&iacute;ch v&agrave; giải quyết c&aacute;c vấn đề. C&aacute;c chuy&ecirc;n ng&agrave;nh c&oacute; thể ph&ugrave; hợp với em như: C&aacute;c ng&agrave;nh thuộc lĩnh vực khoa học tự nhi&ecirc;n (to&aacute;n, l&yacute;, h&oacute;a, sinh, địa l&yacute;, địa chất, thống k&ecirc;, kh&iacute; tượng thủy văn&hellip;); khoa học x&atilde; hội (nh&acirc;n học, t&acirc;m l&yacute;&hellip;); y - dược (b&aacute;c sĩ g&acirc;y m&ecirc;, hồi sức, b&aacute;c sĩ phẫu thuật, nha sĩ&hellip;); khoa học c&ocirc;ng nghệ (c&ocirc;ng nghệ th&ocirc;ng tin, m&ocirc;i trường, điện, vật l&yacute; kỹ thuật, x&acirc;y dựng&hellip;); n&ocirc;ng l&acirc;m (n&ocirc;ng học, th&uacute; y&hellip;). Em cũng c&oacute; thể ph&ugrave; hợp trở th&agrave;nh nh&agrave; ph&acirc;n t&iacute;ch thị trường, lập tr&igrave;nh vi&ecirc;n</p>','2019-05-12 16:55:42','2019-05-12 16:55:42'),(14,'3','<p>Những người c&oacute; chỉ số cao ở lĩnh vực n&agrave;y l&agrave; những người khả năng về trực gi&aacute;c, khả năng tưởng tượng cao, th&iacute;ch l&agrave;m việc trong c&aacute;c m&ocirc;i trường mang t&iacute;nh ngẫu hứng, kh&ocirc;ng khu&ocirc;n mẫu. Những chuy&ecirc;n ng&agrave;nh c&oacute; thể ph&ugrave; hợp với em như: C&aacute;c ng&agrave;nh về văn chương; b&aacute;o ch&iacute; (b&igrave;nh luận vi&ecirc;n, dẫn chương tr&igrave;nh&hellip;); điện ảnh, s&acirc;n khấu, mỹ thuật, ca nhạc, m&uacute;a, kiến tr&uacute;c, thời trang, hội họa, gi&aacute;o vi&ecirc;n dạy sử/Anh văn, bảo t&agrave;ng, bảo tồn... Em cũng c&oacute; thể ph&ugrave; hợp với ng&agrave;nh chăm s&oacute;c sắc đẹp; Nghệ thuật tr&igrave;nh diễn; Thiết kế nội thất; Kiến tr&uacute;c sư; Nhiếp ảnh&hellip;.</p>','2019-05-12 16:56:17','2019-05-12 16:56:17'),(15,'4','<p>Những người c&oacute; chỉ số cao ở lĩnh vực n&agrave;y c&oacute; khả năng về ng&ocirc;n ngữ, giảng giải, th&iacute;ch l&agrave;m những việc như giảng dạy, cung cấp th&ocirc;ng tin, sự chăm s&oacute;c, gi&uacute;p đỡ, hoặc huấn luyện cho người kh&aacute;c. C&aacute;c chuy&ecirc;n ng&agrave;nh c&oacute; thể ph&ugrave; hợp với em như: Sư phạm; giảng vi&ecirc;n; huấn luyện vi&ecirc;n điền kinh; nh&agrave; tư vấn t&acirc;m l&yacute; - hướng nghiệp; c&ocirc;ng t&aacute;c x&atilde; hội, y tế cộng đồng, chuy&ecirc;n gia thẩm định gi&aacute;, nghi&ecirc;n cứu quy hoạch đ&ocirc; thị, kinh tế gia đ&igrave;nh, tuyển dụng nh&acirc;n sự, c&ocirc;ng an, nh&agrave; x&atilde; hội học, Y t&aacute;, Hướng dẫn vi&ecirc;n du lịch; Quảng c&aacute;o; Quan hệ c&ocirc;ng ch&uacute;ng (PR); Bưu điện&hellip;</p>','2019-05-12 16:56:51','2019-05-12 16:56:51'),(16,'6','<p>Những người c&oacute; chỉ số cao ở lĩnh vực n&agrave;y l&agrave; những người kh&ocirc;ng chỉ th&iacute;ch l&agrave;m việc với người kh&aacute;c, em c&ograve;n muốn thuyết phục người kh&aacute;c.&nbsp; Họ c&oacute; khả năng về kinh doanh, mạnh bạo, d&aacute;m nghĩ d&aacute;m l&agrave;m, c&oacute; khả năng quản l&yacute;. Những chuy&ecirc;n ng&agrave;nh c&oacute; thể ph&ugrave; hợp với em như: C&aacute;c ng&agrave;nh về quản trị kinh doanh (quản l&yacute; kh&aacute;ch sạn, quản trị nh&acirc;n sự&hellip;), thương mại, marketing, kế to&aacute;n &ndash; t&agrave;i ch&iacute;nh, luật sư, dịch vụ kh&aacute;ch h&agrave;ng, tiếp vi&ecirc;n h&agrave;ng kh&ocirc;ng, th&ocirc;ng dịch vi&ecirc;n, pha chế rượu, kỹ sư kỹ thuật hệ thống c&ocirc;ng nghiệp, b&aacute;c sĩ cấp cứu, quy hoạch đ&ocirc; thị, b&aacute;o ch&iacute; (ph&oacute;ng vi&ecirc;n, bi&ecirc;n tập vi&ecirc;n&hellip;)&hellip; Em cũng c&oacute; thể th&agrave;nh c&ocirc;ng trong ng&agrave;nh Luật ; Ch&iacute;nh trị ; Ngoại thương ;&nbsp; v&agrave; Ng&acirc;n h&agrave;ng</p>','2019-05-12 16:57:33','2019-05-12 16:57:33'),(17,'5','<p>Những người c&oacute; chỉ số cao ở lĩnh vực n&agrave;y l&agrave; những người quan t&acirc;m tới chi tiết, c&oacute; t&iacute;nh tổ chức v&agrave; th&iacute;ch l&agrave;m việc với số liệu, với con số, theo những quy tr&igrave;nh chỉ dẫn r&otilde; r&agrave;ng. Những nghề ph&ugrave; hợp với em như: Kế to&aacute;n, Thư k&yacute;, Lưu trữ học v&agrave; quản trị văn ph&ograve;ng, Bảo hiểm, Quản trị dữ liệu, Ph&acirc;n t&iacute;ch dữ liệu Ng&acirc;n h&agrave;ng/Tổ chức, Quản l&yacute; xử l&yacute; số liệu khoa học</p>','2019-05-12 16:58:48','2019-05-12 16:58:48');
