INSERT INTO `question_neos` VALUES (1,'<p>T&ocirc;i l&agrave; người l&agrave;m việc năng suất v&agrave; lu&ocirc;n ho&agrave;n th&agrave;nh c&ocirc;ng việc.</p>',0,'2019-05-09 07:02:44','2019-05-09 07:02:44'),(2,'<p>Đ&ocirc;i khi t&ocirc;i c&oacute; thể đe dọa hoặc nịnh bợ người kh&aacute;c để họ l&agrave;m những g&igrave; t&ocirc;i muốn.&nbsp;</p>',1,'2019-05-09 07:17:40','2019-05-09 07:59:14'),(3,'<p>T&ocirc;i kh&ocirc;ng quan t&acirc;m tới thẩm mỹ v&agrave; nghệ thuật.&nbsp;</p>',1,'2019-05-09 07:23:51','2019-05-09 07:59:22'),(4,'<p>&nbsp;Hiếm khi t&ocirc;i c&oacute; cảm gi&aacute;c sợ h&atilde;i hay lo lắng.&nbsp;</p>',1,'2019-05-09 07:24:07','2019-05-09 07:26:43'),(5,'<p>T&ocirc;i thấy m&igrave;nh dễ đồng cảm với người kh&aacute;c.</p>',0,'2019-05-09 07:24:25','2019-05-09 07:59:29'),(6,'<p>T&ocirc;i l&agrave;m việc đều đặn để ho&agrave;n th&agrave;nh c&ocirc;ng việc đ&uacute;ng thời hạn.</p>',0,'2019-05-09 07:27:46','2019-05-09 08:00:00'),(7,'<p>Khi cần t&ocirc;i c&oacute; thể mỉa mai v&agrave; trở n&ecirc;n cay độc.&nbsp;</p>',1,'2019-05-09 07:28:00','2019-05-09 07:59:51'),(8,'<p>T&ocirc;i &iacute;t quan t&acirc;m đến việc t&igrave;m hiểu bản chất vũ trụ hay lo&agrave;i người.&nbsp;</p>',1,'2019-05-09 07:28:14','2019-05-09 08:00:08'),(9,'<p>Hiếm khi t&ocirc;i buồn hay ch&aacute;n nản.&nbsp;</p>',1,'2019-05-09 07:28:34','2019-05-09 08:00:16'),(10,'<p>T&ocirc;i l&agrave; người cởi mở v&agrave; dễ chấp nhận c&aacute;ch sống của người kh&aacute;c.</p>',0,'2019-05-09 07:28:50','2019-05-09 07:28:50'),(11,'<p>Khi bắt tay v&agrave;o một c&ocirc;ng việc, hầu như t&ocirc;i lu&ocirc;n lu&ocirc;n ho&agrave;n th&agrave;nh n&oacute;.</p>',0,'2019-05-09 07:29:32','2019-05-09 07:29:32'),(12,'<p>Đ&ocirc;i khi t&ocirc;i lừa mọi người l&agrave;m những g&igrave; t&ocirc;i muốn.&nbsp;</p>',1,'2019-05-09 07:30:05','2019-05-09 08:00:28'),(13,'<p>Một số thể loại nhạc c&oacute; sức cuốn h&uacute;t rất lớn đối với t&ocirc;i.</p>',0,'2019-05-09 07:30:53','2019-05-09 07:30:53'),(14,'<p>H